import React from 'react'
import logo from '../../logo.svg'
import Needs from './Needs';

function CharityInfo(props) {
    return (
        <div>
            <p><b>Nome</b> 123</p>
            <p><b>Necessidades</b></p>
            <Needs />
            <button>Ver detalhes</button>
            <img src={logo}></img>
        </div>
    )
}

export default CharityInfo
